const Paginate = (gamesPerPage, allGames, paginate)=>{
  let liId=0
  const pageNumbers = []
  for(let i=0; i <Math.ceil(allGames/gamesPerPage);i++){
    pageNumbers.push(i+1)
  }
  return(
    <div>
      {pageNumbers?.map(num=>{
        liId++;
         return(
          <button key={liId} onClick={()=>paginado(num)}>{num}</button>
         )
        })
      }
    </div>
  )
}

export default Paginate
